function SysControllerInit(sipboxId,matchRegex,sr){
	sip = new CFCASIPInput(sipboxId, SIP_TYPE_SYSTEM_KEYBOARD);
	sip.clearInputValue(sipboxId);
	
    if (CFCA_OK != sip.setMinLength(sipboxId, 6)) alert("setMinLength error");
    if (CFCA_OK != sip.setMaxLength(sipboxId, 20)) alert("setMaxLength error");
    if (CFCA_OK != sip.setOutputType(sipboxId, OUTPUT_TYPE_ORIGINAL)) alert("setOutputType error");
    if (CFCA_OK != sip.setServerRandom(sipboxId, sr)) alert("setServerRandom error");
    if (CFCA_OK != sip.setCipherType(sipboxId, CIPHER_TYPE_RSA)) alert("setCipherType error");
    if (CFCA_OK != sip.setMatchRegex(sipboxId, matchRegex)) alert("setMatchRegex error");
    return sip;
}
function SoftControllerInit(sipboxId,matchRegex,sr){
	
	sip = new CFCASIPInput(sipboxId, SIP_TYPE_SOFT_KEYBOARD);
	sipRandom[sipboxId] = 3;
    sip.bindSIPInputBox(sipboxId);
    if (CFCA_OK != sip.setRandomType(sipboxId, 3)) alert("setRandomType error");
    
    if (CFCA_OK != sip.setMinLength(sipboxId, 6)) alert("setMinLength error");
    if (CFCA_OK != sip.setMaxLength(sipboxId, 20)) alert("setMaxLength error");
    if (CFCA_OK != sip.setOutputType(sipboxId, OUTPUT_TYPE_ORIGINAL)) alert("setOutputType error");
    if (CFCA_OK != sip.setServerRandom(sipboxId, sr)) alert("setServerRandom error");
    if (CFCA_OK != sip.setCipherType(sipboxId, CIPHER_TYPE_RSA)) alert("setCipherType error");
    if (CFCA_OK != sip.setMatchRegex(sipboxId, matchRegex)) alert("setMatchRegex error");
    return sip;
}

function checkRegex(sipboxId,matchRegex) {
    if (sip.checkMatchRegex(sipboxId, matchRegex)) {
    	return true;
    } else {
    	return false;
    }
}

function checkEqual(sipInput1,sipboxId1, sipboxId2) {
    if (sipInput1.checkInputValueMatch(sipboxId1, sipboxId2)) {
    	return true;
    } else {
    	return false;
    }
}

function clearInput(sipboxId) {
    sip.clearInputValue(sipboxId);
}

